'use strict';

/**
 * @ngdoc directive
 * @name emiApp.directive:imagePreview
 * @description
 * # imagePreview
 */
angular.module('planillasApp')
    .directive('imagePreview', function () {
        return {
            restrict: 'A',
            scope: {
                imagePreview: '=',
                ngModel: '='
            },
            link: function (scope, elem) {
                var reader = new FileReader();
                reader.onload = function (e) {
                    var imgPreview = e.target.result;
                    if (imgPreview.search('data:application/pdf') > -1) {
                        imgPreview = 'data:image/png;base64,';
                    }
                    scope.imagePreview = imgPreview;
                    scope.$apply();
                };

                elem.on('change', function () {
                    reader.readAsDataURL(elem[0].files[0]);
                });

                scope.$watch('ngModel', function () {
                    if (!scope.ngModel) {
                        scope.imagePreview = '';
                    }
                });

            }
        };
    });
